export const data = [
  {
    product_name: 'produto 1',
    price: (Math.random(0, 1000) * 1000),
    qty: Math.floor(Math.random() * 15),
    _id: 1,
  },
  {
    product_name: 'produto 2',
    price: (Math.random(0, 1000) * 1000),
    qty: Math.floor(Math.random() * 15 + 1),
    _id: 2,
  },
  {
    product_name: 'produto 3',
    price: (Math.random(0, 1000) * 1000),
    qty: Math.floor(Math.random() * 15),
    _id: 3,
  },
]

function removeItem(id){
  data.filter((a)=>{
    return a._id != id
  });
}
export default removeItem;
